Anything other than the training is done in the callback. Looking at https://tensorpack.readthedocs.io/tutorial/extend/callback.html, there are two ways you can add this logic:
```python
class A(Callback):
    def _before_run(self, _):
        return tf.train.SessionRunArgs(fetches=[], feed_dict={'learning_rate:0': np.random.rand()})

class B(Callback):
    def _setup_graph(self):
        self._lr = [k for k in tf.global_variables() if k.name == 'learning_rate:0'][0]
    def _trigger_step(self):
        self._lr.load(np.random.rand())
```

